function Menu(){
    return(
      <p>
        menu:
        <ul>
          <li><a href="/profil">Profil</a></li>
          <li><a href="/proyek">Proyek</a>
        <ul>
        <li><a href="/proyek/web-app">Web App</a></li>
        <li><a href="/proyek/mobile-app">Mobile App</a></li>
        </ul>
        </li>
        </ul>
      </p>
  
    );
  }

  export default function WebApp(){
    return(
        <div>
          <h1>Web App</h1>
          <p>Web App adalah aplikasi yang dijalankan dalam web browser</p>
          <hr />
          <Menu />
        </div>
      )
    }
